q=A.a([new A.bv("Otezla Enrollment Form","Otezla (apremilast) is a prescription medication used to treat adults with moderate to severe plaque psoriasis who are candidates for phototherapy or systemic therapy. It is also used to treat adult patients with active psoriatic arthritis. Otezla is a pill that is taken once a day.\nOtezla works by blocking the activity of a protein called phosphodiesterase 4 (PDE4). PDE4 is involved in the production of inflammatory molecules. By blocking PDE4, Otezla helps to reduce inflammation and improve the symptoms of psoriasis and psoriatic arthritis.\nOtezla is a safe and effective medication for the treatment of psoriasis and psoriatic arthritis. However, it can cause some side effects, such as nausea, diarrhea, and headache. These side effects are usually mild and go away on their own.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FOtezla%20Enrollment%20form.pdf?alt=media&token=01a0ec30-fc70-4c13-87c4-725a1f4e73f1"),new A.bv("Skyrizi Enrollment Form","Skyrizi (risankizumab-rzaa) is a prescription medication used to treat adults with moderate to severe plaque psoriasis. It is a type of biologic therapy that works by blocking the action of a protein called interleukin-23 (IL-23). IL-23 plays a role in the immune system's response to psoriasis. By blocking IL-23, Skyrizi can help to reduce inflammation and improve skin lesions.\nSkyrizi is given as an injection under the skin. The usual dosage is 150 mg once every 12 weeks. Side effects of Skyrizi can include upper respiratory infections, headache, and fatigue.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fskyrizi-complete-enrollment-form.pdf?alt=media&token=4d88cb17-47d0-402c-b427-90a5b98564ef"),new A.bv("Dupixent Atopic Dermatitis",a0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDupixent-Atopic-Dermatitis-Enrollment-Form-English.pdf?alt=media&token=da72f95c-13a8-4b61-9397-53eb5e51d583"),new A.bv("Dupixent Prurigo Nodularis",a0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDupixent-Prurigo-Nodularis-Enrollment-Form-English.pdf?alt=media&token=522e59d7-1072-406e-beb4-888009d9e2a9"),new A.bv("Cosentyx Enrollment Form","Cosentyx is a prescription medication that is used to treat adults with moderate to severe plaque psoriasis who are candidates for phototherapy or systemic therapy. It is also used to treat adults with active psoriatic arthritis, ankylosing spondylitis, and ulcerative colitis. Cosentyx is a subcutaneous injection that is given once a month.\nCosentyx works by blocking the activity of a protein called interleukin-17A (IL-17A). IL-17A is a cytokine that plays a role in inflammation. By blocking IL-17A, Cosentyx helps to reduce inflammation and improve the symptoms of psoriasis, psoriatic arthritis, ankylosing spondylitis, and ulcerative colitis.\nCosentyx is a safe and effective medication for the treatment of psoriasis, psoriatic arthritis, ankylosing spondylitis, and ulcerative colitis. However, it can cause some side effects, such as injection site reactions, upper respiratory tract infections, and headache. These side effects are usually mild and go away on their own.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDermatology%20forms.pdf?alt=media&token=9e81351c-d5df-444f-b61d-7ba82c4f79fd&_gl=1*1nvrhxr*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTAwNzIuNjAuMC4w"),new A.bv("Dermatology Enrollment Form","Dermatology is the branch of medicine that deals with the skin, hair, nails, and mucous membranes. Dermatologists diagnose and treat a wide variety of skin conditions, including acne, eczema, psoriasis, skin cancer, and nail disorders. They also provide cosmetic services, such as laser hair removal and skin rejuvenation.\nDermatologists are medical doctors who have completed at least three years of residency training in dermatology. They are experts in the diagnosis and treatment of skin conditions, and they are also trained to perform a variety of cosmetic procedures.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDermatology%20forms.pdf?alt=media&token=9e81351c-d5df-444f-b61d-7ba82c4f79fd&_gl=1*sxg9t6*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMDk5MzMuMjcuMC4w"),new A.bv("Ilumya Enrollment Form","Ilumya is a prescription medication that is used to treat adults with moderate to severe plaque psoriasis who are candidates for phototherapy or systemic therapy. It is also used to treat adults with active psoriatic arthritis. Ilumya is a subcutaneous injection that is given once every 3 months.\nIlumya works by blocking the activity of a protein called interleukin-23 (IL-23). IL-23 is a cytokine that plays a role in inflammation. By blocking IL-23, Ilumya helps to reduce inflammation and improve the symptoms of psoriasis and psoriatic arthritis.\nIlumya is a safe and effective medication for the treatment of psoriasis and psoriatic arthritis. However, it can cause some side effects, such as injection site reactions, upper respiratory tract infections, and headache. These side effects are usually mild and go away on their own.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FILUMYA_Enrollment-Form.pdf?alt=media&token=b7ecc10b-cf3d-4e7a-8183-718579d04241&_gl=1*8ch68t*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTAyODEuNTIuMC4w"),new A.bv("Taltz Enrollment Form",a1,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Ftaltz-enrollment-form.pdf?alt=media&token=df8dd1c5-dd98-4c26-8713-d9f6ed408d6e&_gl=1*1tclkfv*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTA0NjEuNTMuMC4w"),new A.bv("Taltz Dermatology Pediatric",a1,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Ftaltz-pediatric-enrollment-form.pdf?alt=media&token=27315a3f-53d2-4792-9d51-9324e8ce3316"),new A.bv(a2,a3,a,a4),new A.bv("Stelara Enrollment Form",a5,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fstelara%20HUB%20FORM.pdf?alt=media&token=1244f3fd-e0bc-4ffc-93a7-f25d7bc2faf6&_gl=1*1ff30ek*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTA0MTMuMTguMC4w"),new A.bv("SILIQ Enrollment Form","Siliq is a prescription medication that is used to treat adults with moderate to severe plaque psoriasis who are candidates for phototherapy or systemic therapy.\nIt is a biologic medication, which means that it is made from living cells.\nSiliq works by blocking the activity of a protein called interleukin-17A (IL-17A). IL-17A is a cytokine that plays a role in inflammation. By blocking IL-17A, Siliq helps to reduce inflammation and improve the symptoms of psoriasis.\nSiliq is given as a subcutaneous injection once every 4 weeks.\nSiliq is generally well-tolerated. The most common side effects are injection site reactions, upper respiratory tract infections, and headache. Other side effects can include nausea, diarrhea, and fatigue.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FSILIQ-Enrollment-Form.pdf?alt=media&token=3b9176c9-d066-4bf5-9ad8-3706dba7b551&_gl=1*dynra6*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTAzNzEuNjAuMC4w"),new A.bv(a6,a7,a,a8),new A.bv("CIBINQO/LITFULO/EUCRISA Prescription and Enrollment Form","CIBINQO, LITFULO, and EUCRISA are all prescription medications used to treat moderate to severe psoriasis. They are all interleukin (IL)-23 inhibitors, which means they work by blocking the activity of IL-23, a protein that plays a role in the development of psoriasis.\nCIBINQO is available as an injection that is given under the skin. LITFULO is available as an injection that is given into a vein. EUCRISA is available as a topical ointment that is applied to the skin.\nAll three medications can cause side effects, such as headache, upper respiratory tract infection, and injection site reactions. CIBINQO can also cause serious side effects, such as infections and allergic reactions. LITFULO can also cause serious side effects, such as infections and hypersensitivity reactions. EUCRISA can also cause serious side effects, such as infections and allergic reactions.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FCIBINQO-LITFULO-EUCRISA%20Pescription%20and%20Enrollment%20Form.pdf?alt=media&token=33880847-c30d-43b4-8a3c-90e2f4a430b7"),new A.bv("Adbry Prescription and Enrollment form","Adbry (tralokinumab-ldrm) is a prescription medication used to treat adults with moderate-to-severe atopic dermatitis (eczema) that is not adequately controlled with topical treatments. It is a monoclonal antibody that works by blocking the action of interleukin-13 (IL-13), a protein that plays a role in the inflammation of eczema. Adbry is given as a subcutaneous injection every two weeks.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FADBRY%20Prescreption%20and%20Enrollment%20form.pdf?alt=media&token=3857dfe0-f345-44ae-aed8-4c0aa2d4500c"),new A.bv("OPZELURA Prescription Enrollment Form","Opzelura (ruxolitinib) is a prescription medication used to treat two skin conditions: mild to moderate eczema (atopic dermatitis) and nonsegmental vitiligo.\nOpzelura is a kinase inhibitor that works by blocking the activity of certain enzymes that play a role in inflammation. It is generally well-tolerated, with the most common side effects being skin irritation, folliculitis (inflammation of the hair follicles), and headache.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FOPZELURA%20Prescription%20Enrollment%20Form.pdf?alt=media&token=4b255906-b756-400a-9f33-45bfe6aef4dd"),new A.bv("Rinvoq Atopic Dermatitis Enrollment Form",a9,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FRinvoq%20Enrollment%20form%20dermatology.pdf?alt=media&token=0306a080-ba62-4c82-a7af-fa6ec6601bed"),new A.bv("Humira Dermatology Enrollment Form",b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-derm.pdf?alt=media&token=03b94511-8d33-4c64-82a7-d9ef71857c2e"),new A.bv("Humira Pediatrics Dermatology Enrollment Form",b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-ped-derm.pdf?alt=media&token=bdb92ac8-d319-4f7e-8318-b5a50a355e7d"),new A.bv(b1,b2,a,b3)],r)
p=A.a([new A.bv("Rheumatology Enrollment Form","Rheumatology is a branch of medicine that deals with the diagnosis, treatment, and prevention of disorders of the joints, muscles, bones, and connective tissues. Rheumatic diseases are characterized by inflammation, pain, stiffness, and swelling. Some of the most common rheumatic diseases include:\nArthritis: Arthritis is a condition that causes inflammation of the joints. There are many different types of arthritis, including osteoarthritis, rheumatoid arthritis, and gout.\nFibromyalgia: Fibromyalgia is a chronic pain disorder that causes widespread pain and tenderness.\nLupus: Lupus is an autoimmune disease that causes inflammation throughout the body.\nScleroderma: Scleroderma is a condition that causes the skin to become thick and tight.\nRaynaud's phenomenon: Raynaud's phenomenon is a condition that causes the fingers and toes to turn white, blue, and red in response to cold or stress.",a,""),new A.bv("Taltz Rheumatology Enrollment Form",a1,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Ftaltz-rheumatology-enrollment-form.pdf?alt=media&token=4aabb309-772a-46f9-adcd-d7a635a48f12"),new A.bv("Rinvoq Rheumatology Enrollment Form",a9,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FRinvoq%20Rheumatology%20Enrollment%20Form.pdf?alt=media&token=ca57c9bc-6b8e-4f38-9ebb-324a7c95d24d"),new A.bv("Humira Rheumatology Enrollment Form",b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-rheum.pdf?alt=media&token=ca4c5da0-00f6-434a-990b-b501effd14c0"),new A.bv("Humira Pediatrics Rheumatology Enrollment Form",b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-ped-rheum.pdf?alt=media&token=e883c027-e983-4405-a55b-63e2ee802c1d"),new A.bv(b1,b2,a,b3)],r)
o=A.a([new A.bv("Asthma Enrollment Form","Asthma is a chronic lung condition that causes the airways to become inflamed and narrow. This makes it difficult to breathe, and can trigger symptoms such as wheezing, coughing, chest tightness, and shortness of breath.\nAsthma is a common condition, affecting about 25 million people in the United States. It can start at any age, but is most common in children.\nThe exact cause of asthma is unknown, but it is thought to be due to a combination of genetic and environmental factors.\nThere is no cure for asthma, but it can be managed with medications and lifestyle changes.\nThe goals of asthma treatment are to prevent symptoms, reduce the frequency and severity of attacks, and improve lung function",a,""),new A.bv("Dupixent Asthma Enrollment Form",a0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDUPIXENT%20ENROLLMENT%20FORM.pdf?alt=media&token=ae699451-f1f6-4cdd-808d-ecd338ed7d21&_gl=1*1amb8kr*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTAxNTUuNDcuMC4w"),new A.bv("Dupixent Nasal Polyps",a0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FDupixent-Nasal-Polyps-Enrollment-Form-English.pdf?alt=media&token=722974de-7780-493b-8f16-5378955181cd"),new A.bv("Nucala Enrollment Form","Nucala (mepolizumab) is a prescription medication used to treat certain types of severe allergies and inflammatory conditions. It is a type of biologic therapy that works by blocking the action of a protein called interleukin-5 (IL-5). IL-5 plays a role in the immune system's response to allergies and inflammation. By blocking IL-5, Nucala can help to reduce inflammation and improve symptoms.\nNucala is given as an injection under the skin or as an intravenous infusion. The dosage and frequency of injections vary depending on the condition being treated. Side effects of Nucala can include headache, upper respiratory infections, and injection site reactions.\nNucala is a relatively new medication, so long-term safety data is still limited. However, studies have shown that it is an effective and safe treatment for certain types of severe allergies and inflammatory conditions.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FGateway_NUCALA_English_FORM.pdf?alt=media&token=52fe6b56-b41e-4487-b92d-80c884e8ccc3"),new A.bv(a2,a3,a,a4),new A.bv("Xolair Prescriber Service Form",a7,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FXOLAIR-Prescriber-Service_Form.pdf?alt=media&token=c3beab87-3587-4169-9abc-60072db63c2d"),new A.bv(a6,a7,a,a8),new A.bv("Fasenra Prescription and Enrollment Form","Fasenra (benralizumab) is a biologic medication used to treat severe eosinophilic asthma in adults. It is a type of monoclonal antibody that works by targeting and removing eosinophils, a type of white blood cell that is increased in people with eosinophilic asthma. Eosinophils can cause inflammation and damage to the airways, which can lead to asthma symptoms.\nFasenra is given as an injection under the skin every four weeks. The most common side effects of Fasenra are headache, upper respiratory infections, and injection site reactions.\nFasenra can be an effective treatment for severe eosinophilic asthma. In clinical studies, Fasenra has been shown to improve lung function, reduce the frequency of asthma attacks, and improve quality of life.",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FFASENRA_Enrollment_Form_and_Patient_Authorization.pdf?alt=media&token=663755a2-5bfe-4ddc-bdf6-7dc0495bdc1b"),new A.bv("TEZSPIRE Prescription and Enrollment Form","Tezspire (tezepelumab-ekko) is a monoclonal antibody medication used to treat severe asthma in adults and adolescents 12 years of age and older. It is the first and only biologic approved for severe asthma without phenotypic or biomarker limitations. Tezspire works by blocking an alarmin called IL-33, which is involved in the inflammation that causes asthma attacks.\nTezspire is given as a subcutaneous injection every four weeks. It is generally well-tolerated, and the most common side effects are upper respiratory tract infections and headache.\nTezspire can help to improve lung function, reduce asthma attacks, and improve quality of life for people with severe asthma",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FTEZSPIRE_Together_Program_Enrollment_Form.pdf?alt=media&token=2037b502-62a2-402e-a6a8-4f05d8a61138")],r)
