m=A.a([new A.bv("Hepatology Enrollment Form","Hepatology is a branch of medicine that deals with the study, diagnosis, and treatment of diseases of the liver, gallbladder, bile ducts, and pancreas. The liver is the largest organ in the body and plays a vital role in many important functions, including:\nDigestion: The liver produces bile, which helps to digest fats.\nMetabolism: The liver helps to metabolize carbohydrates, proteins, and lipids.\nDetoxification: The liver helps to detoxify harmful substances from the body.\nStorage: The liver stores vitamins, minerals, and glucose.\nBlood clotting: The liver produces proteins that are essential for blood clotting.",a,"")],r)
l=A.a([new A.bv("Multiple Sclerosis Enrollment Form","Multiple sclerosis (MS) is a chronic disease that affects the central nervous system (CNS), which is made up of the brain, spinal cord, and optic nerves. In MS, the immune system attacks the myelin sheath, which is a protective layer that surrounds nerve fibers. This damage can disrupt the flow of information between the brain and the rest of the body, leading to a variety of symptoms.\nMS is a progressive disease, which means that it gets worse over time. However, the rate of progression varies from person to person. Some people with MS have a mild form of the disease that only causes occasional symptoms, while others have a more severe form that can lead to significant disability.\nThere is no cure for MS, but there are treatments that can help to manage the symptoms and slow the progression of the disease. Treatment options include medications, physical therapy, and lifestyle changes.",a,"")],r)
k=A.a([new A.bv("HIV Enrollment Form","Human immunodeficiency virus (HIV) is a virus that attacks the body's immune system. The virus is spread through contact with blood, semen, vaginal fluids, or breast milk. HIV can also be spread from mother to child during pregnancy, childbirth, or breastfeeding.\nThere is no cure for HIV, but there are treatments that can help people with HIV live long and healthy lives. These treatments, called antiretroviral therapy (ART), can suppress the virus to the point where it is undetectable in the blood. People with HIV who are on ART and have an undetectable viral load cannot transmit the virus to others.\nThe symptoms of HIV infection can vary from person to person. Some people may not experience any symptoms for many years. Others may experience flu-like symptoms shortly after infection, such as fever, fatigue, sore throat, and swollen lymph nodes. As the virus progresses, people with HIV may develop other symptoms, such as weight loss, diarrhea, and skin rashes.",a,"")],r)
j=A.a([new A.bv("Osteoporosis Enrollment Form","Osteoporosis is a condition in which the bones become weak and brittle, making them more likely to break. The word 'osteoporosis' comes from the Greek words 'osteon,' meaning bone, and 'porosis,' meaning porous.\nIn osteoporosis, the body breaks down bone tissue faster than it rebuilds it. This can happen for a number of reasons, including:\nLow levels of estrogen, which occurs naturally after menopause in women and can also be caused by certain medications or medical conditions\nAge\nFamily history\nCertain medical conditions, such as rheumatoid arthritis or hyperthyroidism\nSome medications, such as steroids",a,"")],r)
i=A.a([new A.bv("Crohn's/Ulcerative Colitis Enrollment Form","Crohn's disease and ulcerative colitis are two types of inflammatory bowel diseases (IBD). IBDs are chronic conditions that cause inflammation of the digestive tract.\nIn Crohn's disease, the inflammation can affect any part of the digestive tract, from the mouth to the anus. In ulcerative colitis, the inflammation is limited to the colon and rectum.\nThe symptoms of Crohn's disease and ulcerative colitis can vary from person to person and can change over time.\nThe exact cause of Crohn's disease and ulcerative colitis is unknown, but it is thought to be due to a combination of genetic and environmental factors.\nThere is no cure for Crohn's disease and ulcerative colitis, but there are treatments that can help to manage the symptoms and improve quality of life. ",a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FCrohnsUlcerative-Colitis-Enrollment-Form-J-Z.pdf?alt=media&token=aa797c10-05f8-4ff5-9de5-1071a9acfc49&_gl=1*5eqlw5*_ga*MzE1MDM1MDU0LjE2OTAxOTEzNDA.*_ga_CW55HF8NVT*MTY5OTAwOTkwMC4zNC4xLjE2OTkwMTAxMTguMTQuMC4w"),new A.bv("Stelara Hub Form",a5,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fstelara-patient-enrollment-form%20CHRON'S.pdf?alt=media&token=a8b5fffd-f189-4bc4-940e-e4d0fad5b390"),new A.bv("Rinvoq Crohn's/UC Enrollment Form",a9,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FRinvoq%20Enrollment%20Form%20Crohn's-Ulcerative%20Colitis.pdf?alt=media&token=f364dd8c-3a30-459a-9b31-100d5235db4b"),new A.bv(b4,b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-gastro.pdf?alt=media&token=427cfd0b-3eb0-48e8-9259-53853eeb6ed1"),new A.bv(b4,b0,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2Fhumira-ambassador-program-ped-gastro.pdf?alt=media&token=c365c443-6b69-4d9b-a962-be0cce358ad3"),new A.bv(b1,b2,a,b3)],r)
h=A.a([new A.bv("Hyperlipidemia Enrollment Form","Hyperlipidemia, also known as high cholesterol, is a condition in which there is too much cholesterol or other fats (lipids) in the blood. Cholesterol is a waxy substance that is essential for the body to function properly. However, too much cholesterol can build up in the arteries and increase the risk of heart disease, stroke, and other health problems.\nThere are two main types of cholesterol: low-density lipoprotein (LDL) cholesterol and high-density lipoprotein (HDL) cholesterol. LDL cholesterol is known as the 'bad' cholesterol because it can build up in the arteries. HDL cholesterol is known as the 'good' cholesterol because it helps to remove LDL cholesterol from the arteries.\nTriglycerides are another type of fat that can build up in the blood. Triglycerides are a type of fat that the body uses for energy. However, too many triglycerides can also increase the risk of heart disease.",a,"")],r)
g=A.a([new A.bv("Erivedge Prescriber Service Form",b5,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FErivedge%20Prescriber%20Service%20Form.pdf?alt=media&token=a01f8ea0-dd41-47d3-ba82-e93eaf2c1aab"),new A.bv("Erivedge Genentech Access Solutions Patient Consent Form",b5,a,"https://firebasestorage.googleapis.com/v0/b/pyramids-careers.appspot.com/o/Forms%2FErivedge%20Genentech%20Access%20Solutions%20Patient%20Consent%20Form.pdf?alt=media&token=3e0db423-c739-4488-b838-61a9d8e9f481")],r)
f=A.a([new A.bv("Hematopoietic Enrollment Form","Hematopoietic refers to the formation of blood cells. The hematopoietic system is responsible for producing all of the blood cells in the body, including red blood cells, white blood cells, and platelets.\nThe hematopoietic system is made up of several organs and tissues, including:\nBone marrow: The bone marrow is the main site of blood cell production. It is found in the cavities of bones, such as the ribs, spine, and pelvis.\nSpleen: The spleen is a small organ located in the upper left abdomen. It filters the blood and removes old or damaged blood cells.\nThymus: The thymus is a small organ located in the chest. It is responsible for the development of T cells, a type of white blood cell.\nLymph nodes: Lymph nodes are small, bean-shaped organs that are found throughout the body. They filter the lymph fluid and remove bacteria and other foreign substances.",a,"")],r)
r=A.a([new A.bv("Migraine Enrollment Form","A migraine is a type of headache that is often described as a severe, throbbing pain on one side of the head. Migraines can also cause nausea, vomiting, sensitivity to light and sound, and other symptoms.\nMigraines are a common disorder, affecting about 1 in 7 people worldwide. They can occur at any age, but they are most common in people between the ages of 20 and 50.\nThe exact cause of migraines is unknown, but they are thought to be caused by a combination of genetic and environmental factors.",a,"")],r)
